import Link from 'next/link';
import style from './navbar.module.css';

export default function NavItem(props) {
    return (
        <li className={style.nav_item}>
            <Link href='#'  >
                <a className={style.icon_button} >{props.text}</a>
            </Link>
        </li>
    )
}
